import './App.css';
import { BrowserRouter ,Routes,Route } from 'react-router-dom';

function App() {


  return (
    <div>
      <BrowserRouter>

        <div>
         <Nav>
          <li>
             <link to='/'>ABOUT</link>
          </li>
          <li>
             <link to='/contact'>Contact </link>
          </li>
          <li>
             <link></link>
          </li>
          </Nav>
        </div>

          <Routes>
            <Route path='/' element={<Home/>}/>
            <Route path='/About' element={<About/>}/>
            <Route path='/Contact' element={<Contact/>}/>
            <Route path='*' element={<h1 className='text-xl'> 404 PAGE NOT FOUND</h1>}/>

          </Routes>
      </BrowserRouter>


     {

     }
    </div>
  );
}

export default App;
